import numpy as np
from operator import xor


def matchPercentage(s,s1):
    count=0
    for i in range(len(s)):
        code1=s[i]
        code2=s1[i]
        for j in range(0,len(s[0]),2):
            if (((xor(int(code1[i]), int(code2[i]))) == 0) and ((xor(int(code1[i + 1]), int(code2[i + 1]))) == 0)):
                    count = count + 2
    return (count / 288)


def rotateLeft(l, d):
    # slice string in two parts for left and right
    #print("d=",d)
    for input in range(len(l)):
        Lfirst = l[input][0: d]
        Lsecond = l[input][d:]
        l[input]=Lsecond + Lfirst
    return  l


def rotateRight(l, d):
    # slice string in two parts for left and right
    for input in range(len(l)):
        Rfirst = l[input][0: len(l[input]) - d]
        Rsecond = l[input][len(l[input]) - d:]
        l[input]=Rsecond+Rfirst
    return l




def hammingdistance(str):
    maxPercentage=0
    codeA=['', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '']
    codeB=str.split()
    print(codeB)
    for numberOfPixelsShift in range(0,50):
        codeC=list(codeB)
        left=rotateLeft(codeC,numberOfPixelsShift*2)
        codeC=list(codeB)
        right=rotateRight(codeC,numberOfPixelsShift*2)
        matchLeft=matchPercentage(codeA,left)
        matchRight=matchPercentage(codeA,right)
        if(maxPercentage<matchLeft):
            maxPercentage=matchLeft
        if(maxPercentage<matchRight):
            maxPercentage=matchRight
    print(maxPercentage)
